account_file_path = ''
asset_proof_file_path = ''
download_file_path = ''
download_account_template_path = ''
download_asset_template_path = ''


def get_undone_enterprises(df_account: DataFrame, df_trans_obj: DataFrame):
    """
    未按时/足额款企业
    :param df_account:
    :param df_trans_obj:
    :return:
    """
    s = df_trans_obj['债务人名称'].drop_duplicates().to_list()
    df_in = df_account[df_account['对方单位名称'].isin(s)][['对方单位名称', '贷方发生额']]
    df_in['贷方发生额'] = df_in['贷方发生额'].replace(r'^\s*$', np.nan, regex=True)
    df_in.dropna(inplace=True)
    df_in['贷方发生额'] = df_in['贷方发生额'].apply(atof)
    return df_in.groupby('对方单位名称').sum().reset_index().rename(columns={'对方单位名称': '企业名称', '贷方发生额': '贷方总额'})


def get_trans_enterprises(df_account: DataFrame, df_opponent: DataFrame):
    """
    互有交易回款企业
    :param df_account:
    :param df_opponent:
    :return:
    """
    df_in = get_opponent_take_in_df(df_account, df_opponent)
    df_out = get_opponent_pay_out_df(df_account, df_opponent)
    df_in['贷方发生额'] = df_in['贷方发生额'].apply(atof)
    df_out['借方发生额'] = df_out['借方发生额'].apply(atof)
    df_in_1 = df_in.groupby('对方单位名称').agg({'交易时间': 'count', '贷方发生额': 'sum'}).reset_index().rename(
        columns={'交易时间': '贷方笔数', '贷方发生额': '贷方总额'})
    df_out_2 = df_out.groupby('对方单位名称').agg({'交易时间': 'count', '借方发生额': 'sum'}).reset_index().rename(
        columns={'交易时间': '借方笔数', '借方发生额': '借方总额'})
    return pd.merge(df_in_1, df_out_2, on=['对方单位名称'])


def get_opponent_take_in_df(df_account: DataFrame, df_opponent: DataFrame):
    """
    对方单位入账 DataFrame
    :param df_account:
    :param df_opponent:
    :return:
    """
    enterprises = df_opponent['交易对手名称'].values.tolist()
    return df_account[(df_account['借/贷'] == '贷') & (df_account['对方单位名称'].isin(enterprises))][
        ['对方单位名称', '贷方发生额', '交易时间']]


def get_opponent_pay_out_df(df_account: DataFrame, df_opponent: DataFrame):
    """
    对方单位出账 DataFrame
    :param df_account:
    :param df_opponent:
    :return:
    """
    enterprises = df_opponent['交易对手名称'].values.tolist()
    return df_account[(df_account['借/贷'] == '借') & (df_account['对方单位名称'].isin(enterprises))][
        ['对方单位名称', '借方发生额', '交易时间']]


def get_enterprise(df_account: DataFrame, df_opponent: DataFrame):
    """
    有回款企业
    :return:
    """
    return get_opponent_pay_out_df(df_account, df_opponent)


def get_amount_dataframe(df: DataFrame):
    """
    总出入账
    :return: DataFrame
    """
    return pd.DataFrame({'总出账金额': [pay_out_amount(df)], '总入账金额': [take_in_amount(df)]})


def pay_out_amount(df: DataFrame):
    """
    出账总金额
    :param df: DataFrame
    :return: 出账总金额
    """
    return amount(df, '借方发生额')


def take_in_amount(df: DataFrame):
    """
    出账总金额
    :param df: DataFrame
    :return: 出账总金额
    """
    return amount(df, '贷方发生额')


def amount(df: DataFrame, column: str):
    """
    计算总金额
    :param df:  DataFrame
    :param column: 列名
    :return: 总金额
    """
    s = df[column].replace(r'^\s*$', np.NaN, regex=True)
    s.dropna(inplace=True)
    locale.setlocale(locale.LC_NUMERIC, '')
    return s.apply(atof).sum()


def upload_account_file_action():
    """
    上传流水文件路径
    :return:
    """
    global account_file_path
    account_file_path = filedialog.askopenfilename()  # 选择打开什么文件，返回文件名，askopenfilename 1次上传1个；askopenfilenames1次上传多个
    account_file_entry.insert(0, account_file_path)  # 文本框获取地址


def upload_asset_proof_file_action():
    """
    上传标的文件路径
    :return:
    """
    global asset_proof_file_path
    asset_proof_file_path = filedialog.askopenfilename()  # askopenfilename 1次上传1个；askopenfilenames1次上传多个
    trans_file_entry.insert(0, asset_proof_file_path)  # 文本框获取地址


def download_file_action():
    """
    下载文件夹路径
    :return:
    """
    global download_file_path
    # askdirectory 文件夹路径
    download_file_path = filedialog.askdirectory()
    # 文本框获取地址
    # download_entry.insert(0, download_file_path)


def export_excel():
    """
    导出结果
    :return:
    """
    try:
        download_file_action()
        account_df = pd.read_excel(account_file_path, sheet_name='银行流水', header=0)
        opponent_df = pd.read_excel(asset_proof_file_path, sheet_name='交易对手列表', header=0)
        trans_obj_df = pd.read_excel(asset_proof_file_path, sheet_name='转让标的清单', header=0)
        df_amount = get_amount_dataframe(account_df)
        df_enterprise = get_enterprise(account_df, opponent_df)
        df_trans = get_trans_enterprises(account_df, opponent_df)
        df_undone = get_undone_enterprises(account_df, trans_obj_df)
        df_long_loan = pd.DataFrame({'企业名称': [], '贷方总金额': [], '借方总金额': [], '典当': [], '小额贷款': []})
        write_file(dir_path=download_file_path, df_amount=df_amount, df_enterprise=df_enterprise, df_trans=df_trans,
                   df_undone=df_undone, df_long_loan=df_long_loan)
        tk.messagebox.showinfo(title='Info', message='导出文件完成')
    except AssertionError:
        tk.messagebox.showerror(title='Error', message='请选择文件')
    except ValueError:
        tk.messagebox.showerror(title='Error', message='流水文件格式不正确')


def write_file(dir_path: str, df_amount: DataFrame, df_enterprise: DataFrame, df_trans: DataFrame, df_undone: DataFrame,
               df_long_loan: DataFrame):
    """
    写入文件
    :param dir_path:
    :param df_amount:
    :param df_enterprise:
    :param df_trans:
    :param df_undone:
    :param df_long_loan:
    :return:
    """
    writer = pd.ExcelWriter(dir_path + '/分析结果.xlsx', engine='xlsxwriter')
    df_amount.to_excel(writer, sheet_name='总出入账金额', index=False, header=True)
    df_enterprise.to_excel(writer, sheet_name='有回款企业', index=False, header=True)
    df_trans.to_excel(writer, sheet_name='互有交易回款企业', index=False, header=True)
    df_undone.to_excel(writer, sheet_name='未按时|足额回款企业', index=False, header=True)
    df_long_loan.to_excel(writer, sheet_name='多头借贷回款企业', index=False, header=True)
    writer.save()


def export_account_template():
    """
    下载 银行流水模板
    :return:
    """
    try:
        writer = pd.ExcelWriter(filedialog.askdirectory() + '/银行流水模板.xlsx', engine='xlsxwriter')
        pd.DataFrame({'交易时间': [], '借/贷': [], '借方发生额': [], '贷方发生额': [], '对方单位名称': []}) \
            .to_excel(writer, sheet_name='银行流水', index=False, header=True)
        writer.save()
        tk.messagebox.showinfo(title='Info', message='导出文件完成')
    except AssertionError:
        tk.messagebox.showerror(title='Error', message='请选择下载文件夹')


def export_asset_template():
    """
    下载 交易对手&转让标的模板
    :return:
    """
    try:
        writer = pd.ExcelWriter(filedialog.askdirectory() + '/交易对手&转让标的模板.xlsx', engine='xlsxwriter')
        pd.DataFrame({'交易对手名称': []}).to_excel(writer, sheet_name='交易对手列表', index=False, header=True)
        pd.DataFrame({'债务人名称': [], '应收账款金额': [], '应收账款到期日': []}) \
            .to_excel(writer, sheet_name='转让标的清单', index=False, header=True)
        writer.save()
        tk.messagebox.showinfo(title='Info', message='导出文件完成')
    except AssertionError:
        tk.messagebox.showerror(title='Error', message='请选择下载文件夹')


